import React, { useState, useEffect } from "react"; // Import React, useState, and useEffect
import axios from "axios"; // Import axios for making HTTP requests
import { useLocation } from 'react-router-dom';
import './home.css';

function Home (){
    const location = useLocation();
    const [userData, setUserData] = useState(location.state ? location.state : {}); // Define userData using useState and setUserData to update it

    useEffect(() => {
        // Fetch user data or perform any other side effects
        // Example:
        // axios.get('api/userData')
        //     .then(response => {
        //         setUserData(response.data);
        //     })
        //     .catch(error => {
        //         console.error('Error fetching user data:', error);
        //     });
    }, []); // Empty dependency array means this effect runs once on component mount

    return (
        <div className="container">
            <div className="box">
                <div style={{textAlign: "center"}}>Connected Devices: <br />
                    <span>{userData.connected}</span>
                </div>
                <div className="right">Network Device Name: <br /> <span>{userData.network}</span></div>
                <div className="left"><span>{location.state.id}</span></div>
            </div>
            <div className="div1">
                <div>
                    <p><i className="fa-solid fa-wallet" style={{color: "orange"}}></i> Curent Balance: <span>{userData.currentBalance}</span></p>
                    <p><i className="fa-solid fa-coins" style={{color: "orange"}}></i> Amount Due: Ksh <span>{userData.Amount}</span></p>
                </div>
                <div>
                    <p><i className="fa-solid fa-check fa-lg" style={{color: "#2fb90c"}} ></i> Payment Status: <span>{userData.payment}</span></p>
                </div>
            </div>
            <div className="div2">
                <p>Current Package</p>
                <div className="net">
                    <div>
                        <p className="span"><span>{userData.networkSpeed}</span></p>
                        <p>Network Speed</p>
                    </div>
                    <div className="line"></div>
                    <div>
                        <p className="span"><span id="remainingDays">{userData.Remaining}</span> Days</p>
                        <p id="expiryDate">Expires on: <span id="expiryDateValue">{userData.subscription}</span></p>
                    </div>
                </div>
            </div>
            <div className="div3">
                <div>
                    <p><i className="fa-solid fa-signal" style={{color: "#dcedf9"}}></i> Signal Strength </p>
                    <p className="dbm">{userData.signal}</p>
                </div>
            </div>
            <div className="net">
                <a href="https://wa.me/+254772809396" target="_blank" rel="noopener noreferrer">Chat with us on WhatsApp</a>
                <a href="/" className="button">Log out</a>
            </div>
        </div>
    );
}

export default Home;
